def pairwise(iterable):
    "s -> (s0,s1), (s1,s2), (s2, s3), ..."
    a, b = itertools.tee(iterable)
    next(b, None)
    return zip(a, b)


def plotTankCycleData():
    title = "Tank Flight Cycle"
    dfTotal = getTankCycleData()
    df = dfTotal.drop(columns=['simulationTime'])
    intervals = [np.inf,1e4,1e2,-np.inf]
    dfs = []
    for upper, lower in pairwise(intervals):
        crit = (upper > df.max()) & (df.max() > lower)
        dfs.append(df[crit.index[crit]])

    source = ColumnDataSource(dfTotal)
    p = figure(title=title, width=1400,
               background_fill_color="#fafafa", #y_range = (df2.min().min(), df2.max().max()),
               tooltips=[(col, f'@{col}') for col in df.columns])
    colors = itertools.cycle(palette)
    legends = []

    p.extra_y_ranges = {str(index): Range1d(start=intervalDf.min().min(), end=intervalDf.max().max())
                        for index, intervalDf in enumerate(dfs)}
        #"y2": Range1d(start=df['pressure'].min(), end=df['pressure'].max()),
        #                "y3": Range1d(start=df['pressure'].min(), end=df['pressure'].max())}
    lineDashs = ['solid', 'dashed', 'dotted', 'dotdash']
    for index, (dash, intervalDf) in enumerate(zip(lineDashs, dfs)):
        legendItems = []
        for col in intervalDf.columns:
            l = p.line('simulationTime', col, color=next(colors), source=source, y_range_name=str(index),
                       line_dash=dash, line_width=3
                       )
            legendItems.append((col, [l]))
        legend = Legend(items=legendItems)
        legend.click_policy="mute"
        legends.append(legend)


    for index, (legend, intervalDf) in enumerate(zip(legends, dfs)):
        p.add_layout(LinearAxis(y_range_name=str(index)), 'right')
        p.add_layout(legend, 'right')
    output_file(title.replace(' ','_') + '.html', title)
    show(p)